INSERT INTO `wt_kc_order` VALUES ('215', '9', 'XL', '35KV大闾变单线改造工程', '', '', '', '', '', '铁塔组立、导线架设搭接等。', '', '', '', '', '', '', null, null, null, '', '防高空坠落、防跑线1、登杆前，应检查杆塔基础埋深及拉线是否可靠，高空作业必须系安全带。2、地面人员应离开杆塔适当距离，防止杆塔上落物伤人。3、在交叉地段施工两侧应设立交通警示标志牌， 4、作业点下方应按坠落半径设围栏或其他保护措施，防止坠落物伤人。5、杆塔上有人工作时，严禁调整或拆除拉线(包括临时拉线)。', null, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '肖旦初', '罗智方、李美文', '2017.01.07', '2017.01.08-01.14', '温岭-非普公司-2017-01-DL-06-011', '肖旦初', '1483782296', null, '0', null);
INSERT INTO `wt_kc_order` VALUES ('216', '9', 'XL', '35KV大闾变单线改造工程25#塔至变电站间隔', '', '', '', '', '', '拉洞开挖、导线架设、搭接，原35KV温闾3725线26#塔至变电站间隔导线拆除等。', '', '', '', '', '', '', null, null, null, '', '1、防跑线伤人，防高空坠落。2、高空作业人员首先必须具有高空作业证，方可进行登高作业。\r\n3、登杆塔前必须检査并配戴安全保护用具，包括安全帽、安全带〔或腰绳及防坠器〕。\r\n4、必须确认杆塔稳定后再登杆塔（地脚螺帽已拧紧、装齐等〕。\r\n5、与地面指挥人保持联系，与地面人员互相配合，保证作业的有序、协调。\r\n6、必须衣着方便和穿胶底鞋。\r\n7、安全带必须栓在牢固的构件上，且不得低挂高用。\r\n8、多人在一处作业或双层作业，应相互照应，密切配合。高处作业区下方不得有人。\r\n', null, '35KV温闾3725线', '', '', '', '', '温岭市供电公司检修工区', '', '', '', '', '线路改为检修状态', '', '', '', '', '', '', '', '在35KV温闾3725线26#塔挂接地线1付', '', '', '', '35KV温闾3725线线路改为检修状态', '', '', '刘庆泉', '文发彪、陈波', '2017.01.08', '2017.01.09', '温岭-非普公司-2017-01-DL-06-012', '刘庆泉', '1483873778', null, '0', null);
INSERT INTO `wt_kc_order` VALUES ('217', '9', 'XL', '35KV大闾变单线改造工程', '', '', '', '', '', '10#塔铁塔组立、10#至11#塔导线架设，原35KV温闾3725线12#至13#塔耐张开断、导线搭接等。', '', '', '', '', '', '', null, null, null, null, '1、防倒塔、防高空坠落。2、高空作业人员首先必须具有高空作业证，方可进行登高作业。\r\n3、登杆塔前必须检査并配戴安全保护用具，包括安全帽、安全带〔或腰绳及防坠器〕。\r\n4、必须确认杆塔稳定后再登杆塔（地脚螺帽已拧紧、装齐等〕。\r\n5、与地面指挥人保持联系，与地面人员互相配合，保证作业的有序、协调。\r\n6、必须衣着方便和穿胶底鞋。\r\n7、安全带必须栓在牢固的构件上，且不得低挂高用。\r\n8、多人在一处作业或双层作业，应相互照应，密切配合。高处作业区下方不得有人。\r\n35KV', null, '35KV温闾3725线', '', '', '', '', '', '', '', '', '', '线路改为检修状态', '', '', '', '', '', '', '', '在35KV温闾3725线12#塔小号侧挂设接地线1付', '', '', '', '35KV温闾3725线线路改为检修状态', '', '', '肖旦初', '罗智方、李美文', '2017.01.08', '2017.01.09', '温岭-非普公司-2017-01-DL-06-013', '肖旦初', '1483878627', null, '0', null);
