INSERT INTO `wt_kc_order` VALUES ('233', '9', 'XL', '35KV长箬3550线（蔡施桥村）', '', '', '', '', '', '基础开挖、浇注等', '', '', '', '', '', '', null, null, null, null, '1.掌握整个操作程序，理解工作任务、质量标准及操作中的危险点及控制措施。\r\n2.“两交”主要内容:工作任务、安全措施、技术措施、岗位分工、现场使用旗语和哨音信号及其他注意事项。\r\n3.“一查”主要内容：人员健康、精神状况、安全工器具是否完备等。\r\n4.起吊钢丝绳应绑在电杆适当的位置，防止电杆突然倾倒。\r\n5.临时拉线不得固定在可能移动或其他不可靠地物体上。\r\n6.应设有专人统一指挥，统一信号、明确分工，并讲明施工方法，明确各，岗位职责，技工岗位不得用民工代替。', null, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '1、进入施工现场正确佩戴安全帽，着装统一规范，正确使用个人防护用品。\r\n2、进入施工现场必须携带“施工证”作业。3、熟悉工作内容，掌握安全措施、明确工作中的危险点控制。4、保证质量可能做到文明施工。', '1、进入施工现场施工负责人必须明确交代工作任务、安全注意事项、危险点预控各项措施；2、施工现场组织民工搬运材料；4、基础开挖、浇注', '夏冰松', '刘庆泉、文发彪', '2017.03.02', '2017.03.03-03.06', '温岭-非普公司-2017-03-DL-06-016', '文发彪', '1488453218', null, '0', null);
